# Picture Base64
# Create the picture object from a base64 code
$Picture_Base64 = ''
$HeroImage = "$env:TEMP\HeroPicture.png"
[byte[]]$Bytes = [convert]::FromBase64String($Picture_Base64)
[IO.File]::WriteAllBytes($HeroImage, $Bytes)
# Picture Base64 end


# Toast design
$Scenario = 'reminder'
$Title = 'Something is wrong with your device'
$Message = "A driver is missing or disabled on your device.`nPlease contact your help desk"
$Attribution = 'Syst and Deploy'

[xml]$Toast = (@'
<toast scenario="{0}">
	<visual>
	<binding template="ToastGeneric">
		<image placement="hero" src="{1}"/>
		<text placement="attribution">{2}</text>
		<text>{3}</text>
		<text>{4}</text>
	</binding>
	</visual>
</toast>
'@ -f $Scenario, $HeroImage, $Attribution, $Title, $Message)
# Toast design end


# Set the AppID
# AppID to use for the toast. We will use PowerShell one
$AppID = '{1AC14E77-02E7-4E5D-B744-2EB1AE5198B7}\WindowsPowerShell\v1.0\powershell.exe'
# Set the AppID end


# Notification area
# This part allows you to let the notification in the notification area
$Notifications_Reg = 'HKCU:\SOFTWARE\Microsoft\Windows\CurrentVersion\Notifications\Settings'
If (-not (Test-Path -Path ('{0}\{1}' -f $Notifications_Reg, $AppID) -ErrorAction SilentlyContinue))
{
   $null = (New-Item -Path ('{0}\{1}' -f $Notifications_Reg, $AppID) -Force -Confirm:$false -ErrorAction SilentlyContinue)
   $null = (New-ItemProperty -Path ('{0}\{1}' -f $Notifications_Reg, $AppID) -Name 'ShowInActionCenter' -Value 1 -PropertyType 'DWORD' -Force -Confirm:$false -ErrorAction SilentlyContinue)
}

If (((Get-ItemProperty -Path ('{0}\{1}' -f $Notifications_Reg, $AppID) -Name 'ShowInActionCenter' -ErrorAction SilentlyContinue).ShowInActionCenter) -ne '1')
{
   $null = (New-ItemProperty -Path ('{0}\{1}' -f $Notifications_Reg, $AppID) -Name 'ShowInActionCenter' -Value 1 -PropertyType 'DWORD' -Force -Confirm:$false -ErrorAction SilentlyContinue)
}
# Notification area end


# Toast creation and display
$null = [Windows.UI.Notifications.ToastNotificationManager, Windows.UI.Notifications, ContentType = WindowsRuntime]
$null = [Windows.Data.Xml.Dom.XmlDocument, Windows.Data.Xml.Dom.XmlDocument, ContentType = WindowsRuntime]
$ToastXml = New-Object -TypeName Windows.Data.Xml.Dom.XmlDocument
$ToastXml.LoadXml($Toast.OuterXml)
[Windows.UI.Notifications.ToastNotificationManager]::CreateToastNotifier($AppID).Show($ToastXml)
# Toast creation and display end

exit 0

